import React from "react";
import {Link} from "react-router-dom";
import "./C.css";
import Service from "../service/Service";

class Html extends React.Component{
    constructor(props){
        super(props)
        this.state={
            htmls:[]
        }
    }
    componentDidMount(){
        Service.getHtml().then((response) => {
            this.setState({htmls:response.data})

        });
    }
    render(){
        return(
            <div>
                <div class="feed1">
                <h3>Html Tutorials</h3>

                    {                        
                        this.state.htmls.map(
                        html =>
                        <ul key={html.id}>

                            <Link to="content" ><li>{html.name}</li></Link>
                        </ul>
                        )
                    }
                </div>
                <div>
                    <div class="content12">
                        <div>

                            {
                                this.state.htmls.map(
                                    html =>
                                    <p key={html.id==2}>
                                        <p>{html.text}</p>
                                    </p>
                                )
                            }

                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
export default Html;
